text:
 @Prusch841  gaúchos: 45x42 pro inter; brasileiros: 3x2 pro inter; copas do Brasil:5x1 pro grêmio; libertadores: 3x2 pro grêmio; mundial: 1x1; rebaixamentos: 3x1 pro grêmio(só q obviamente é negativo).

Grêmio é o time q tem mais participações no brasileiro ao lado do Santos, e tem bem mais tradição na liberta q o Inter. 

E aí? Quem for o maior, é por coisa pouca.
